import React from "react";

function Home() {
  const service = [
    {
      id: 1,
      service_name: "Spa",
      cost: 1350000,
    },
    {
      id: 2,
      service_name: "Salon",
      cost: 1150000,
    },
    {
      id: 3,
      service_name: "Gym",
      cost: 750000,
    },
    {
      id: 4,
      service_name: "Nail",
      cost: 870000,
    },
    {
      id: 5,
      service_name: "Makeup",
      cost: 1500000,
    },
    {
      id: 6,
      service_name: "Mi",
      cost: 2200000,
    },
  ];
  return (
    <div className="home-container">
      <div className="home-content">
        <div className="home-bg">
          <div className="home-display"></div>
          <div className="home-items">
            <div className="home-item">
              <img />
              <div>
                <p>Giá tiền</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
